import React from 'react'
import Logo from './../img/Sabor_Badalona.png';
import { Link } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import { Navbar } from 'react-bootstrap';
const handleDestroySession = () => {
  sessionStorage.removeItem('username');
  sessionStorage.removeItem('role');
  window.location.href = '/loginUser';
};
export default function NavbarElement() {
  return (
    <Navbar >
      <Container bg="light" variant="dark">
      <Row className="align-items-center">
        <Col>
          <div className="d-flex align-items-center">
            <Link to="/" className="text-decoration-none">
              <img src={Logo} alt="Logo" width="60" className="rounded-circle me-2 img-fluid w-40" />
              <span className="text-decoration-none fs-4 text-black">Cool kids club</span>
            </Link>
          </div>
        </Col>
        <Col className="text-center">
          <p>suf</p>
        </Col>
        <Col className="d-flex justify-content-end">
          {sessionStorage.getItem("username") && (
            <Link className="btn btn-outline-primary me-2" to="/SearchFriends">
              Search Friends
            </Link>
          )}
          {!sessionStorage.getItem("username") && (
            <Link className="btn btn-outline-primary me-2" to="/loginUser">
              Sign In
            </Link>
          )}
          {sessionStorage.getItem("username") ? (
            <button className="btn btn-outline-primary" onClick={handleDestroySession}>
              Log Out
            </button>
          ) : (
            <Link className="btn btn-outline-primary" to="/adduser">
              Make an Account
            </Link>
          )}
        </Col>
      </Row>
    </Container>
    </Navbar>
  )
}
